INSERT INTO `gunung` (`id`, `negara_id`, `kode_kabupaten_kota`, `lokasi`, `nama`, `slug`, `deskripsi`, `long`, `lat`, `elev`, `point`, `created_at`, `updated_at`) VALUES
(1, 1, '33.23', NULL, 'Sindoro', 'sindoro', 'Gunung Sindoro menjulang tinggi di tengah Pulau Jawa, berdiri megah dengan ketinggian sekitar 3.150 meter di atas permukaan laut. Layaknya dua saudara kembar, Gunung Sindoro dan Gunung Sumbing berdampingan, menciptakan lanskap alami yang memukau mata setiap pendaki dengan keindahan alam yang mempesona. Pendakian ke puncaknya adalah perjalanan melintasi keharmonisan antara alam dan manusia. Jalur yang menantang menjadi bagian tersendiri bagi para pendaki yang berjuang melawan lelah demi menyaksikan matahari pagi dari sudut Gunung Merbabu, Merapi, dan Lawu.', '109.99586908104298', '-7.3020264538039585', 3146, 0x000000000101000000588bab51bc7f5b409e75366c46351dc0, '2024-11-06 23:34:59', '2025-08-01 23:21:10'),
(2, 1, '52.08', NULL, 'Rinjani', 'rinjani', 'Gunung Rinjani adalah gunung berapi aktif yang terletak di Pulau Lombok, Nusa Tenggara Barat, Indonesia. Dengan ketinggian mencapai 3.146 meter di atas permukaan laut, Gunung Rinjani adalah gunung tertinggi kedua di Indonesia setelah Gunung Semeru. Gunung ini terkenal dengan kaldera luasnya yang membentuk Danau Segara Anak, sebuah danau vulkanik yang merupakan salah satu daya tarik utama bagi para pendaki. Rinjani merupakan bagian dari Taman Nasional Gunung Rinjani yang menawarkan berbagai jenis ekosistem, termasuk hutan hujan tropis, padang rumput alpine, dan kawasan vulkanik. Pendakian ke puncak Gunung Rinjani menawarkan pemandangan spektakuler dan merupakan salah satu pengalaman mendaki yang paling populer di Indonesia.', '116.4579010559627', '-8.41196114070152', 3726, 0x000000000101000000790a3b404e1d5d405f121592ecd220c0, '2024-11-06 23:34:59', '2025-08-01 23:21:10'),
(3, 1, '33.23', NULL, 'Sumbing', 'sumbing', 'Gunung Sumbing adalah gunung api yang terdapat di Jawa Tengah, Indonesia. (Ketinggian puncak 3.371 mdpl), gunung Sumbing merupakan gunung tertinggi ketiga di Pulau Jawa setelah Gunung Semeru dan Gunung Slamet. Gunung ini secara administratif terletak di tiga wilayah kabupaten, yaitu Kabupaten Magelang; Kabupaten Temanggung; dan Kabupaten Wonosobo. Bersama dengan Gunung Sindoro, Gunung Sumbing membentuk bentang alam gunung kembar, seperti Gunung Merapi dan Gunung Merbabu, apabila dilihat dari arah Temanggung.', '110.07267138333827', '-7.383850273910521', 3371, 0x000000000101000000c2b2dfa5a6845b407b06d40b10891dc0, '2024-10-04 21:28:21', '2025-08-01 23:21:10'),
(4, 1, '33.03', NULL, 'Slamet', 'slamet', 'Gunung Slamet adalah gunung tertinggi di Jawa Tengah dan gunung tertinggi kedua di pulau Jawa, setelah Gunung Semeru. Gunung Slamet merupakan sebuah gunung berapi kerucut tipe A yang berada di Jawa Tengah, Indonesia, dan merupakan gunung tunggal yang terpisah dari pegunungan. Gunung Slamet memiliki ketinggian 3.432 mdpl dan terletak di antara 5 kabupaten, yaitu Kabupaten Banyumas, Kabupaten Purbalingga, Kabupaten Pemalang, Kabupaten Tegal dan Kabupaten Brebes.', '109.2166489050698', '-7.241508941777212', 3432, 0x0000000001010000004c7f5e93dd4d5b40b07fba1e4ef71cc0, '2024-12-12 11:14:57', '2025-08-01 23:21:10'),
