(10, 1, '32.03', NULL, 'Gede', 'gede', 'Gunung Gede merupakan sebuah gunung berapi kerucut Tipe A yang berada di bagian barat Pulau Jawa, Indonesia. Gunung Gede berada dalam ruang lingkup Taman Nasional Gede Pangrango, yang merupakan salah satu dari lima taman nasional yang pertama kali diumumkan di Indonesia pada tahun 1980. Gunung ini berada di dua wilayah kabupaten yaitu Kabupaten Cianjur dan Sukabumi, dengan ketinggian 1.000 - 2.961 mdpl, dan berada pada lintang 106°51\' - 107°02\' BT dan 64°1\' - 65°1 LS. Suhu rata-rata di puncak gunung Gede adalah 18 °C di siang hari dan di malam hari suhu puncak berkisar 5 °C, dengan curah hujan rata-rata 3.600 mm/tahun (Source: Wikipedia).', '106.9826369016485', '-6.790093070717774', 2961, 0x000000000101000000141be385e3be5a40c01d6e280e291bc0, '2025-01-03 01:18:10', '2025-08-01 23:21:10'),
(11, 1, '32.01', NULL, 'Salak', 'salak', 'Gunung dengan hutan hujan tropis lebat', '106.73376202182244', '-6.715760095965672', 2215, 0x0000000001010000008db1fbf4f5ae5a404ad1ef36f0dc1ac0, '2025-01-03 23:26:24', '2025-08-01 23:21:10'),
(15, 1, '13.02', NULL, 'Talang', 'talang', 'Gunung populer di Solok', '100.68058654669873', '-0.9792674774747335', 2597, 0x000000000101000000cb0ae0ba8e2b5940ef4ab9bf2856efbf, '2025-01-05 06:47:46', '2025-08-01 23:21:10'),
(16, 1, '32.03', NULL, 'Pangrango', 'pangrango', 'Gunung Pangrango merupakan sebuah gunung berapi kerucut tidak aktif yang terdapat di bagian barat pulau Jawa, Indonesia. Gunung ini tumbuh di dinding Kaldera Gunung Pangrango Purba. Gunung Pangrango mempunyai ketinggian setinggi 3.023 meter di atas permukaan laut. Puncaknya dinamakan Puncak Mandalawangi. Puncak Mandalawangi juga merupakan titik pertemuan batas tiga kabupaten yaitu Kabupaten Bogor, Kabupaten Cianjur dan Kabupaten Sukabumi. Gunung Pangrango termasuk salah satu gunung yang berusia muda (Rudianto,2020), dimana pembentukannya terjadi selama perioda Kuarter sekitar 3 juta tahun yang lalu. Gunung ini terbentuk dari proses subduksi pulau Jawa yang berada di atas Lempeng Sunda dengan Samudra Hindia yang merupakan bagian dari Lempeng Indo-Australia. Pada awalnya, Gunung Pangrango merupakan gunung berapi yang aktif (Rudianto,2020). Namun, statusnya telah dinyatakan sebagai gunung berapi yang sudah mati dikarenakan tidak adanya aktivitas vulkanis (Sastha, 2007). Di puncak Gunung Pangrango yang rata terdapat sebuah dataran bernama Alun-Alun Mandalawangi. Luasnya adalah 4,39 hektar. Di Alun-Alun Mandalawangi tidak terdapat kawasan hutan karena tanahnya yang tandus dan sering terbentuk kabut yang dingin. Namun, Alun-Alun Mandalawangi menjadi habitat alami bagi tumbuhan edelweis. (Wikipedia)', '106.96426113844416', '-6.770045085790699', 3023, 0x000000000101000000f89a5974b6bd5a4090aaefb286141bc0, '2025-01-05 09:12:22', '2025-08-01 23:21:10'),
