(45, 1, '33.08', NULL, 'Merbabu', 'merbabu', 'Gunung Merbabu tergolong gunung api tua yang sudah tidak aktif lagi. Gunung ini berada pada ketinggian tempat ± 600 – 3.142 m di atas permukaan air laut. Gunung Merbabu mempunyai tujuh puncak, yaitu: (1) Puncak Pertapaan, (2) Puncak Watutulis, (3) Puncak Gegersapi, (4) Puncak Syarif, (5) Puncak Ondorante, (6). Puncak Kenteng Songo, dan (7) Puncak Trianggulasi. Puncak Gunung Merbabu dapat dicapai melalui 4 (empat) jalur pendakian yaitu melalui Dusun Tekelan (Desa Batur), Dusun Cuntel (Desa Kopeng), Dusun Genting (Desa Tarubatang), dan Dusun Kedakan (Desa Kenalan). Selain jalur tersebut untuk mencapai puncak hampir sebagian besar dari dusun sekitar kawasan hutan dapat digunakan sebagai jalur pendakian. Namun demikian telah dibuat aturan bahwa jalur resmi pendakian hanya. (sumber: https://tngunungmerbabu.org/)', '110.44064165513589', '-7.453681414736721', 3145, 0x00000000010100000018840e79339c5b4090635cdc91d01dc0, '2025-02-01 23:25:15', '2025-08-01 23:21:10'),
